function Hearth_bracelet_gold() {
  return (
    <>
      <Slideshow />
      <h1>Made Bij Sjors</h1>
              <p>Discover de nieuwe sieraden</p>
      <Footer />
    </>
  );
}

export default Hearth_bracelet_gold;
